CREATE TABLE m_jenis_laporan (
    id_jenis_laporan            int8 NOT NULL GENERATED BY DEFAULT AS IDENTITY( INCREMENT BY 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1 NO CYCLE),
    bentuk_usaha                uuid,
    kode_jenis_laporan          varchar(100) NOT NULL DEFAULT ''::character varying,
    uraian_jenis_laporan        varchar(100) NOT NULL DEFAULT ''::character varying,
    keterangan_jenis_laporan    text NOT NULL DEFAULT ''::text,
    level_jenis_laporan         int4 NOT NULL DEFAULT 0,
    parent_id_jenis_laporan     int4 NOT NULL DEFAULT 0,
    CONSTRAINT m_jenis_laporan_pkey PRIMARY KEY (id_jenis_laporan)
);

-- Add indexes for better performance
CREATE INDEX idx_m_jenis_laporan_bentuk_usaha ON m_jenis_laporan(bentuk_usaha);
CREATE INDEX idx_m_jenis_laporan_kode_jenis_laporan ON m_jenis_laporan(kode_jenis_laporan);
CREATE INDEX idx_m_jenis_laporan_uraian_jenis_laporan ON m_jenis_laporan(uraian_jenis_laporan);
CREATE INDEX idx_m_jenis_laporan_level_jenis_laporan ON m_jenis_laporan(level_jenis_laporan);
CREATE INDEX idx_m_jenis_laporan_parent_id_jenis_laporan ON m_jenis_laporan(parent_id_jenis_laporan);

-- Add foreign key constraint
ALTER TABLE m_jenis_laporan ADD CONSTRAINT fk_m_jenis_laporan_bentuk_usaha FOREIGN KEY (bentuk_usaha) REFERENCES m_bentuk_usaha(id_bu);

